import React from 'react';
import SerreData from './SerreData';

const serres = [
  { id: 1 },
  { id: 2 },
  { id: 3 },
  { id: 4 },
]

interface DataProps {
  number: number;
  showCharts: () => void;
  showTable: () => void;
}

function Data(props: DataProps) {
  const { showCharts, showTable } = props;
  return (
    <div>
      {serres.map((serre) => (
        <SerreData number={serre.id} showCharts={showCharts} showTable={showTable}/>
      ))}
    </div>
  );
}

export default Data;
